class Main2 extends Component{
	render() {
		return (
			<div>
				<img className="background_image_card" src={main2_img} />
				<h3 className="background_image_font">
					<p>Sangeet Night</p>
					<p>Feb 12 2022</p>
					<p>at</p>
						<p>Gill Family House</p>
						 <br className="clear" />
				</h3>
			</div>
		)
	}
}

export default Main2
